    return (
      <div className="Comments">
        <div class="name-container"> 
            <div class="circle"> </div> 
            <p class="name">${comment.name} </p>
            <p class="date"> ${date(comment.timestamp)} </p>
        </div> 
        <p class="comment"> ${comment.comment} </p> 
      </div>
    )
  }
}

export default Comments;
